import React from "react";
import "./style-login.css";

import Header_Logo from "../Header/Header_Logo/header_logo";

const Login = () => {
    return (
        <div className="login">
            <Header_Logo/>
            <div className="inputs_login">
                <p>E-mail:</p>
                <input type="email"/>
                <p>Senha:</p>
                <input type="password"/>
                <button type="submit">Entrar</button>
            </div>
        </div>
    );
}

export default Login;
